ction () {\n    /**\n     * @variable cb_obj `fig_ohlc.x_range`.\n     * @variable source `ColumnDataSource`\n     * @variable ohlc_range `fig_ohlc.y_range`.\n     * @variable volume_range `fig_volume.y_range`.\n     */\n    \"use strict\";\n\n    let i = Math.max(Math.floor(cb_obj.start), 0),\n        j = Math.min(Math.ceil(cb_obj.end), source.data['ohlc_high'].length);\n\n    let max = Math.max.apply(null, source.data['ohlc_high'].slice(i, j)),\n        min = Math.min.apply(null, source.data['ohlc_low'].slice(i, j));\n    _bt_scale_range(ohlc_range, min, max, true);\n\n    if (volume_range) {\n        max = Math.max.apply(null, source.data['Volume'].slice(i, j));\n        _bt_scale_range(volume_range, 0, max * 1.03, false);\n    }\n\n}, 50);\n"},"id":"443539","type":"CustomJS"},{"attributes":{},"id":"443724","type":"StringFormatter"},{"attributes":{},"id":"443682","type":"StringFormatter"},{"attributes":{"border_line_color":"#333333","click_policy":"hide","coordinates":null,"group":null,"items":[{"id":"443319"},{"id":"443342"},{"id":"443367"},{"id":"443394"}],"label_text_font_size":"8pt","location":"top_left","margin":0,"padding":5,"spacing":0},"id":"443318","type":"Legend"},{"attributes":{"data":{"equity_dd":{"__ndarray__":"AAAAAAAA8D8AAAAAAADwPwAAAAAAAPA/AAAAAAAA8D8AAAAAAADwPwAAAAAAAPA/AAAAAAAA8D8AAAAAAADwPwAAAAAAAPA/AAAAAAAA8D8AAAAAAADwPwAAAAAAAPA/AAAAAAAA8D8AAAAAAADwPwAAAAAAAPA/AAAAAAAA8D8AAAAAAADwPwAAAAAAAPA/AAAAAAAA8D8AAAAAAADwPwAAAAAAAPA/AAAAAAAA8D8AAAAAAADwPwAAAAAAAPA/AAAAAAAA8D8AAAAAAADwPwAAAAAAAPA/AAAAAAAA8D8AAAAAAADwP2lQx1ykNew/9GZnytmg7D8f4JLLwJzrP905J+9uyus/QHN6Ibnr6T98MHL+Z6jrP5xbxSVjK+w/r8uD7bIE7D/+1Gbw3ebrPx5UK/vvHOw/CCfrH4VG6z8H60jdD5PqP2duGpHI5eo/RAvAULth6j8SJ+fVNPHpP0dTiOwSMuo/FohEoU+c6j8Cne+nsArqP3Bh3j7wROo/tQ7+j0dy6j+DPBf81vXpPzfLZmnsXuk/FpOTP7ip6T/MXlyqvNXpP7zWOieWAuk/M3z7hOen6D9h7YRNPXnoPxcrW5CmQ+o/OHF0SzXG6z8Tz8pi22vrP06HUFutJu0/+Bs50u1J7D9DdFQ1FQbsP2tgnGQkROs/2RsSCFmE6z+LmG+OWPnqP6G5mjw5Z+s/g8AWu1GI6z/wV6iQWuDrP9xz9t9oNew/yqE2Fo1+7D+zZaCNi
